print("\033[0;32m\n»«---ඇම්මට බැම්මට ලිං ---ගැට්ටේ තියම් තොපේ අම්මව •➸⃟̗̗̗̗̗̗̗̗̗̗̗̗̗̗̀̀̀̀̀̀̀̀̀̀̀̀̀😌⍤⃝😉──බඩ කරන්නේ දැන ගනිම් මූසල ──නවක මෝඩ සිපයියෙක්නේ ─◎⃝හුත්තෝ තෝ ඈහ්════◄••❀••►😂➸⃟̗̗̗̗̗̗̗̗̗̗̗̗̗̗̀̀̀̀̀̀̀̀̀̀̀̀̀❁ཻ͜͡😍⍤⃝✾⁽≼ »̶̶͓͓͓̽̽̽ලැජ්ජ වෙයං තොපෙ අම්මගෙ ❁͜͡පිත්තම  ❁ཻ͜͡හැදි ගාව ගන්නේ නැතුව 💝☞පලයං මූසලයා ➳̶🤧🍀\n මෙහෙ වරෙං හුත්තිගෙ කොල්ලො අවුස්ස ගත්ත නං උබෙ අම්මගෙ කබර කිම්බ බේරගනිං කැරි හුත්තිගෙ කොල්ලා දෙක නැති මුඩුක්කු හුත්තිගෙ පුතා😂👌 උබෙ අම්මගෙ හුතු ගැට්ටෙ නැගලා තන් ගැට්ටෙ එල්ලිල කිබි ගැට්ට සුන්නත්දූලි වෙන්ඩ් ගහන්නෙ හුත්තිගෙ කොල්ලො :3 ඔහොම කොහොමද පොන්නයා අපෙ එකෙක් ටෝක් කරලා මාරු වෙන්නෙ උබ බලාගෙන ඉන්නකොට උබෙ අම්මට හුකනවා හුත්තිගෙ පුතා හුත්ත නවලා හුත්ත අස්සටම ගහනවා 😂 කො පොන්නයා කෝඩ් අරන් වරෙන් එකෙක්ගෙ හරි උබෙ අම්මගෙ හුත්ත හත් කඩකට පලල දෙන්නං මගේ ජානෙ නාස් පොල්ලෙන් පයින්ඩ අබ්බගාත මෝඩ හුත්තිගෙ කොල්ලො😂\nඔයී මංද මානසික සමනල් කැරියෝ සමනල් හැගුමෙන් ද පොන්නයෝ කොටන්නෙ🖕. උඹේ ඔය සමනල් පොන්න ටෝක් හරියන් නෑ පොන්නයෝ පල ගිහින් උබේ අම්මගෙ කිම්බෙ ජූස් බිලා වරෙන්😆👌🖕 ඕයි ඔයි ඔය නිකන් ඉන්න ගමන් මෙන්න මේ ලින්ක් එකට ගිහින් සබ්ස්ක්‍රයිබ් කරන් යනවකෝ අවුලක් නෑ.රෝ මොඩ්ස් චැනල් එක🙈ඕයි මං දැන් උබේ අම්මට මට කියලා නිව්ටන්ගෙ දෙවන නියමයට අනුව හුකා ගන්න ඔනෑද ")